def InstallSys(drvPath, drvName):
	scManager = win32service.OpenSCManager(None, None, win32service.SC_MANAGER_CREATE_SERVICE)

	try:
		service = win32service.CreateService(scManager,
							drvName,
							drvName,
							win32service.SERVICE_ALL_ACCESS,
							win32service.SERVICE_KERNEL_DRIVER,
							win32service.SERVICE_DEMAND_START,
							win32service.SERVICE_ERROR_NORMAL,
							drvPath, None, 0, None, None, None)
	except:
		print(win32api.GetLastError())
		print("Failed to install driver")
		return False

	win32service.CloseServiceHandle(service)
	win32service.CloseServiceHandle(scManager)

	return True

def GetTimeDiff(startTime, endTime):
	return (int(endTime, 16) - int(startTime, 16))/10000000

def muHelper(hDev, place):
	print(f"place: {place} ")
	#click ferea
	StartAction(hDev, place)

	#check if click was succefull
	if os.path.isfile(f"templates\\no_spot.png") == False or os.path.isfile(f"templates\\yes_spot.png") == False:
		print("file could not be read, check with os.path.exists()")
		return
	
	template = cv.imread(f"templates\\no_spot.png", cv.IMREAD_GRAYSCALE)
	assert template is not None, "file could not be read, check with os.path.exists()"
	
	template2 = cv.imread(f"templates\\yes_spot.png", cv.IMREAD_GRAYSCALE)
	assert template2 is not None, "file could not be read, check with os.path.exists()"
	
	meth= 'cv.TM_CCOEFF_NORMED' 
	method = eval(meth)

	i = 0
	while(True) :
		if IsActionFinished("no_warp.png", 1):
			StartAction(hDev, "CancelMuHelper")
			return False

		pyautogui.screenshot(f"test_case.png")
		img = cv.imread(f"test_case.png", cv.IMREAD_GRAYSCALE)
		assert img is not None, "file could not be read, check with os.path.exists()"

		# Apply template Matching
		res = cv.matchTemplate(img, template, method)
		res2 = cv.matchTemplate(img, template2, method)
		
		max_val = cv.minMaxLoc(res)[1]
		max_val2 = cv.minMaxLoc(res2)[1]
		
		print("no spot: ", max_val)
		print("yes spot: ", max_val2)
		
		if max_val > 0.8 and max_val > max_val2:
			print("MuHelper no free spot")
			return False
		elif max_val2 > 0.8 and max_val2 > max_val:
			time.sleep(1)
			i+=1
			print(f"Searching spot i: {i}")
			if i> 5:
				print("Spot found")
				return True


def getFirstFreeSrv():
	num = 6	
	while(num <= 14):
		print(f"templates\\mid{num}_not_full.png")
		if os.path.isfile(f"templates\\mid{num}_not_full.png") == False:
			print("file could not be read, check with os.path.exists()")
			return

		pyautogui.screenshot(f"test_case_{num}.png")
		img = cv.imread(f"test_case_{num}.png", cv.IMREAD_GRAYSCALE)
		assert img is not None, "file could not be read, check with os.path.exists()"

		template = cv.imread(f"templates\\mid{num}_not_full.png", cv.IMREAD_GRAYSCALE)
		assert template is not None, "file could not be read, check with os.path.exists()"
		
		template2 = cv.imread(f"templates\\mid{num}_full.png", cv.IMREAD_GRAYSCALE)
		assert template is not None, "file could not be read, check with os.path.exists()"
		
		meth= 'cv.TM_CCOEFF_NORMED' 
		method = eval(meth)

		# Apply template Matching
		res = cv.matchTemplate(img, template, method)
		res2 = cv.matchTemplate(img, template2, method)

		max_val = cv.minMaxLoc(res)[1]
		max_val2 = cv.minMaxLoc(res2)[1]

		print("max val: ", max_val)
		print("max val2: ", max_val2)

		if max_val > 0.8 and max_val > max_val2:
			return num
		elif max_val2 > 0.8 and max_val2 > max_val:
			print(f"Server {num} full")
			num += 1
		else:
			time.sleep(2)
			print("Trying again")

def IsActionFinished(action_fname, max_iter = sys.maxsize):
	i = 0
	while(True):
		print(f"{action_fname}")
		if os.path.isfile(f"templates\\{action_fname}") == False:
			print("file could not be read, check with os.path.exists()")
			return

		pyautogui.screenshot(f"screen.png")
		img = cv.imread(f"screen.png", cv.IMREAD_GRAYSCALE)
		assert img is not None, "file could not be read, check with os.path.exists()"

		template = cv.imread(f"templates\\{action_fname}", cv.IMREAD_GRAYSCALE)
		assert template is not None, "file could not be read, check with os.path.exists()"

		meth= 'cv.TM_CCOEFF_NORMED' 
		method = eval(meth)
		res = cv.matchTemplate(img, template, method)
		min_val, max_val, min_loc, max_loc = cv.minMaxLoc(res)

		print("max val: ", max_val)
		i += 1
		
		if max_val > 0.8:
			print("Action finished")
			return True
		elif i >= max_iter:
			return False
		else:
			time.sleep(2)
			print("Trying again ", i)

def StartAction(hDev, fileName):
	if(hDev == None) :
		return
	#change this to current directory
	f = open(f"vinputs\\{fileName}.txt", "rb")
	
	if f == None :
		print("Failed to open file")

	sep = f.read(1)
	f.read(7)
	nTime = f.read(8)[::-1].hex()
	i = 1
	lTime = nTime
	print(f'{sep} {nTime}')
	while True:
		sep = f.read(1)#sep
		if sep == b'':
			break
		f.read(7)#garbage check why it's generated
		nTime = f.read(8)[::-1].hex()#time

		if(sep.hex() != START_ACTION and sep.hex() != END_ACTION ):
			print(GetTimeDiff(lTime, nTime))
			time.sleep(GetTimeDiff(lTime, nTime))
		
		lTime = nTime
		if sep.hex() == KBD_DEVICE:
			print("entered KBD_DEVICE")
			data = f.read(12)		
			win32file.DeviceIoControl(hDev, InsertKeyStrokeOp, data, None, None)
		elif sep.hex() == MOU_DEVICE:
			print("entered MOU_DEVICE")
			data = f.read(24)		
			win32file.DeviceIoControl(hDev, InsertMouseOp, data, None, None)
		elif sep.hex() == START_ACTION:
			print("entered START_ACTION")
		elif sep.hex() == END_ACTION:
			print("entered END_ACTION")
			print("sleeping")
			break

	f.close()

