def SysOp(drvName, drvPath, operation):
	scManager = win32service.OpenSCManager(None, None, win32service.SC_MANAGER_CONNECT)
	service = win32service.OpenService(scManager, drvName, 0x0010 | 0x0020 | 0x00010000)

	if service != None :
		if operation == START_SYS :	
			win32service.StartService(service, None)			
		if operation == STOP_SYS :
			win32service.ControlService(service, win32service.SERVICE_CONTROL_STOP)
			os.remove(drvPath)
		elif operation == DELETE_SYS :
			try:
				win32service.DeleteService(service)
			except:
				print("Failed to delete driver", win32api.GetLastError())

		win32service.CloseServiceHandle(service)
	win32service.CloseServiceHandle(scManager)

